    not yet reimbursed.  The corresponding debt entry is on Schedule D.   The void
    of the $7,000 payment to Drew Zinecker was originally reported on 10/15/13.  The
    original check could not be cashed and was reissued on 10/21/13.  Both were reported
    on the November Monthly Report.  Stop-payment was placed on the check on 2/27/14
    and is reported on this report.  The payment on H4 for communications consulting
    on 2/28/14 was for general party communications consulting and does not meet the
    definition of Federal Election Activity in 100.24.  No employee whose salary or
    benefits appears on schedule H-4 spent more than 25% of their time on Federal
    Election Activity this month. Furthermore, there were no employees who spent more
    than 25% of their time on FEA this month.  When an employee does spend more than
    25% of their time on FEA, their salary will be properly disclosed on Line 30(b)
    and paid entirely with federal funds.     Additionally, utilities are included
    in the Committee's rent payments.  \n"
